import "./App.css";
import Todos from "./Todos";
import { useAuthState } from "react-firebase-hooks/auth";
import { auth } from "./firebase";
import firebase from "firebase";

const sighInWithGoogle = () =>
  auth.signInWithPopup(new firebase.auth.GoogleAuthProvider());

const SignIn = () => (
  <body>
    <nav className="App-header"> TODO APP </nav>
    <main>
      <button onClick={sighInWithGoogle}>Sign In With Google</button>
    </main>
    <footer className="footer">
      <div className="footer-header"> Connect With Me </div>
      <ul class="footer-links">
        <li>
          <a class="link" href="https://github.com/devdeadviz">
            Github
          </a>
        </li>
        <li class="list-item-inline">
          <a
            class="link"
            href="https://www.linkedin.com/in/kuldeep-gupta-871230194/"
          >
            LinkedIn
          </a>
        </li>
        <li class="list-item-inline">
          <a class="link" href="https://www.instagram.com/ig_deadviz/">
            Instagram
          </a>
        </li>
      </ul>
    </footer>
  </body>
);

const App = () => {
  const [user] = useAuthState(auth);

  return user ? <Todos /> : <SignIn />;
};

export default App;
